import React from "react";
import Dog from '../Dog/Dog';
//import { Link } from "react-router-dom";

const Dogs = ({ dogs, loading }) => {
  // useEffect(() => {
  //   window.scrollTo(0, 0)
  // }, []);

  if (loading === 0) {
    return <h2> Los doggys están cargando...</h2>;
  }

  return (
    <div>
      {dogs?.map((e, i) => {
        return (
          <div key={e.id}>
            <h1>{e.name}</h1>
            <h2>{e.temperament}</h2>
            <h3>{e.weight_min}</h3>
            <h3>{e.weight_max}</h3>
            <img src={e.image} alt="Debería haber una foto/" />
          </div>
          /*Dog */
        );
      })}
    </div>
  );
};
export default Dogs;
